import { TransactionsProvider } from "./contexts/TransactionsContext";
import { RoutersMain } from "./routers/routers";
import { StyledGlobal } from "./styles/global";

const App = () => {
  return (
    <>
      <StyledGlobal />
      <TransactionsProvider>
        <RoutersMain />
      </TransactionsProvider>
    </>
  );
};

export default App;
